import React from 'react';
import classes from './Services.module.css';

import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';

const Services = () => {
  return (
    <React.Fragment>
      <h2>We offer a complete range of features</h2>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6} lg={4}>
          <h4>Global Talent Registration Center</h4>
          <p>Eos tota dicunt democritum no. Has natum gubergren ne. Est viris soleat sadipscing cu.</p>
        </Grid>
      </Grid>
    </React.Fragment>
  )
};

export default Services;
